import Vuex from 'vuex';
import Vue from 'vue';
import axios from 'axios';

Vue.use(Vuex);


export default new Vuex.Store({
    state: {
        foo: [],
        location: null,
        position: null,
        locations: {
            "Beijing": {lat: 39.9390731, lng: 116.1172741},
            "Delft": {lat: 52.01165376397885, lng: 4.359065304767967},
            "New York": {lat: 40.7128, lng: -74.0060},
            "Melbourne": {lat: -37.8136, lng: 144.9631}
        },
        snapshots: [{
            "location": {lat: 52.0112957, lng: 4.3532808},
            "pov": {heading: 91.51, pitch: -10},
            "First": "data:image/png;base64,",
            "Second": "data:image/png;base64,",
            "Third": "data:image/png;base64,",
            "Fourth": "data:image/png;base64,",
            "Fifth": "data:image/png;base64,",
            "Sixth": ""
            }, {
                "location": {lat: 52.0113703, lng: 4.3594027},
                "pov": {heading: 253.41, pitch: -10},
                "First": "data:image/png;base64,",
                "Second": "data:image/png;base64,",
                "Third": "data:image/png;base64,",
                "Fourth": "data:image/png;base64,",
                "Fifth": "",
                "Sixth": ""
            }],
        verifyVotes: []
    },
    getters: {
        getFoo: (state) => state.foo,
        getLocation: (state) => state.location,
        getPosition: (state) => state.position,
        getCoordinates: (state) => state.locations[state.location],
        getSnapshots: (state) => state.snapshots,
        getVerifyVotes: (state) => state.verifyVotes
    },
    mutations: {
        setFoo: (state, foo) => (state.foo = foo),
        setLocation: (state, location) => (state.location = location),
        setPosition: (state, position) => (state.position = position),
        setVerifyVotes: (state, value) => (state.verifyVotes.push(value))
    },
    actions: {
        async loadFoo({commit}) {
            axios.get('http://localhost:8080/foo').then(response => {
                commit('setFoo', response.data)
            });
        },
        updateVerifyVotes({commit}, keyValue) {
            commit('setVerifyVotes', keyValue);
        }
    }
});